import React from "react";
import "./Header.css";

function Header() {
  return (
    <div className="header">
      <div className="header-logo">
        <h1>
          Mot <span>ors</span>
        </h1>
      </div>
      <div className="header-nav">
        <ul>
          <li>Home</li>
          <li>Cars</li>
          <li>Services</li>
          <li>Blog</li>
        </ul>
      </div>
    </div>
  );
}

export default Header;
